        external
        onlyOwner
    {
        require(_percentInBP > 0 && _percentInBP <= 2000, "SaitaStake: Not in Range");
        require(_time>=30 days,"Minimum time not met!");
        rewardPercent[_time] = _percentInBP;
    }

    /*
